import React from 'react';
import './LoginPage.css';

const LoginPage = () => {
    return (
        <div className = 'wrapper'>
            <form action="">
                <h1>Login</h1>
                <div className="input-box">
                    <input type="text" placeholder=''/>
                </div>
            </form>
        </div>
    )
}

export default LoginPage
